data.value:
if (document.getElementById('errorDetails')) {
    var details = [];
    var statusCode = '';
    var message = '';
    var cells = document.getElementsByTagName('TD');

    for (var i = 0; i < cells.length; i += 2) {
        var label = cells[i].innerText;
        var value = cells[i + 1].innerText;

        if (label === 'Message: ') {
            message = value;
        } else if (label === 'HTTP Error Code: ') {
            statusCode = value;
        }

        details.push(label);
        details.push(value);
        details.push('- ');
    }

    if (details.length) {
        details.pop();
    }

    try {
        if (typeof window.external !== 'undefined' && typeof window.external.notifyScriptError !== 'undefined') {
            try {
                window.external.notifyScriptError(document.location, message, details.join(''), statusCode, document.documentElement.innerHTML);
            }
            catch (x) {
                window.external.notifyScriptError(document.location, message, details.join(''), statusCode);
            }
        }
        else if (typeof window.notifyScriptError !== 'undefined') {
            window.notifyScriptError(document.location, message, details.join(''), statusCode, document.documentElement.innerHTML);
        }
    }
    catch (x) {
        document.write('<p>' + x + '</p>');
    }
}

try {
    if (typeof window.external !== 'undefined' && typeof window.external.resizeWindow !== 'undefined') {
        window.external.resizeWindow('');
    }
    else if (typeof window.resizeWindow !== 'undefined') {
        window.resizeWindow('');
    }
}
catch (x) {
   //Ignore any error for resizing
}

